import logo from './logo.svg';
import './App.css';
import Example from './Example.js';
const Wrapper =styled.div`
    background-color: #fff;
    color: #000;
    font-size: 14px;

    @media (min-width: 768px){
        font-size: 30px;
    }
    @media (min-width: 992px){
        font-size: 60px;
    }

`;
function App() {
  return (
    <Wrapper>
    <h1>fafafafaf</h1>
    <p>afffffffffffff</p>
</Wrapper>
  );
}

export default App;
